import React from "react";
import { View, ScrollView, Text, Button, TouchableOpacity } from "react-native";
import styled from "styled-components/native";
import {
  useSafeAreaInsets,
  SafeAreaView,
} from "react-native-safe-area-context";

const SafeCon = styled.SafeAreaView`
  width: 100%;
  background-color: #ffffff;
`;

const Con = styled.SafeAreaView`
  height: 100%;
  width: 100%;
`;

const ListCard = styled.ScrollView`
  height: 100%;
  width: 100%;
  padding: 15px;
`;

const Card = styled.View`
  width: 100%;
  height: 150px;
  margin-bottom: 50px;
`;

const ReservBtn = styled.TouchableOpacity`
  width: 50%;
  height: 30px;
  background-color: #a5d6a7;
  color: #ffffff;
`;

const ShopTitle = styled.Text`
  font-size: 18px;
  flex-wrap: wrap;
`;

const ShopDes = styled.Text`
  margin-top: 3px;
  color: #bdbdbd;
`;

const HeaderLogo = styled.Text`
  font-size: 16px;
  color: black;
  padding: 15px;
`;

export {
  Con,
  HeaderLogo,
  SafeCon,
  ListCard,
  Card,
  ShopDes,
  ShopTitle,
  ReservBtn,
};
